import React, { useState } from 'react';
import { fetchData } from '../api';

const HealthForm = () => {
    const [formData, setFormData] = useState({
        age: '',
        height: '',
        weight: '',
        activityLevel: '',
        gender: '',
        dailyWaterIntake: '',
        sleepHours: '',
        stressLevel: '',
    });

    const handleChange = (name, value) => {
        setFormData({
            ...formData,
            [name]: value
        });
    };

    const handleSubmit = async () => {
        const data = await fetchData('/predict', formData);
        console.log('Erhaltene Daten:', data);
        // Hier kannst du die erhaltenen Daten weiter verarbeiten oder anzeigen
    };

    return (
        <div style={styles.formContainer}>
            <h2 style={styles.heading}>Health Assessment Form</h2>

            <label style={styles.label}>Alter:</label>
            <input
                type="number"
                style={styles.input}
                value={formData.age}
                onChange={e => handleChange('age', e.target.value)}
            />

            <label style={styles.label}>Größe (cm):</label>
            <input
                type="number"
                style={styles.input}
                value={formData.height}
                onChange={e => handleChange('height', e.target.value)}
            />

            <label style={styles.label}>Gewicht (kg):</label>
            <input
                type="number"
                style={styles.input}
                value={formData.weight}
                onChange={e => handleChange('weight', e.target.value)}
            />

            <label style={styles.label}>Aktivitätslevel:</label>
            <input
                type="number"
                style={styles.input}
                value={formData.activityLevel}
                onChange={e => handleChange('activityLevel', e.target.value)}
            />

            <label style={styles.label}>Geschlecht:</label>
            <select
                style={styles.select}
                value={formData.gender}
                onChange={e => handleChange('gender', e.target.value)}
            >
                <option value="">Bitte wählen...</option>
                <option value="1">Männlich</option>
                <option value="2">Weiblich</option>
            </select>

            <label style={styles.label}>Tägliche Wasseraufnahme (Gläser):</label>
            <input
                type="number"
                style={styles.input}
                value={formData.dailyWaterIntake}
                onChange={e => handleChange('dailyWaterIntake', e.target.value)}
            />

            <label style={styles.label}>Schlafstunden:</label>
            <input
                type="number"
                style={styles.input}
                value={formData.sleepHours}
                onChange={e => handleChange('sleepHours', e.target.value)}
            />

            <label style={styles.label}>Stresslevel (1-10):</label>
            <input
                type="number"
                style={styles.input}
                value={formData.stressLevel}
                onChange={e => handleChange('stressLevel', e.target.value)}
            />

            <button style={styles.button} onClick={handleSubmit}>Absenden</button>
        </div>
    );
};

const styles = {
    formContainer: {
        maxWidth: '500px',
        margin: '50px auto',
        padding: '20px',
        borderRadius: '8px',
        boxShadow: '0 0 20px rgba(0, 0, 0, 0.1)',
        backgroundColor: '#fff',
    },
    heading: {
        textAlign: 'center',
        marginBottom: '20px',
        fontSize: '24px',
        color: '#333',
    },
    label: {
        display: 'block',
        marginBottom: '10px',
        fontWeight: 'bold',
        color: '#555',
    },
    input: {
        width: '100%',
        padding: '10px',
        marginBottom: '20px',
        borderRadius: '4px',
        border: '1px solid #ccc',
        fontSize: '16px',
        boxSizing: 'border-box',
    },
    select: {
        width: '100%',
        padding: '10px',
        marginBottom: '20px',
        borderRadius: '4px',
        border: '1px solid #ccc',
        fontSize: '16px',
        boxSizing: 'border-box',
        appearance: 'none',
    },
    button: {
        width: '100%',
        padding: '15px',
        borderRadius: '4px',
        border: 'none',
        backgroundColor: '#007BFF',
        color: '#fff',
        fontSize: '18px',
        cursor: 'pointer',
        textTransform: 'uppercase',
        fontWeight: 'bold',
    }
};

export default HealthForm;
